import React, { useRef } from "react";
import "./home.css";
import Zoom from "react-reveal/Zoom";

function Home() {
  const heroContentRef = useRef(null);
  const _onMouseMove = () => {
    const width = useRef(heroContentRef.width);
    const height = useRef(heroContentRef.height);
    console.log(width, height);
  };
  return (
    <div className="home">
      <div className="heroCenterContainer">
        <div
          className="heroContent"
          ref={heroContentRef}
          onMouseMove={_onMouseMove}
        >
          <Zoom>
            <div className="heroText white-text">Sophia Orlando</div>
          </Zoom>
        </div>
      </div>
    </div>
  );
}

export default Home;
